import React, { useState } from "react";
import { api_url } from "../src/config/Config";
import _fetch from "./config/api";
import toasted from "./config/toast";

export default function Register() {

    const { allFields, setAllFields } = useState({
        name: "",
        email: "",
        phone: "",
        password: ""
    });

    const handleChange = (event) => {
        setAllFields({
            ...allFields,
            [event.target.name]: event.target.value
        })
    }

    const SubmitRegister = async () => {
        let response = await _fetch(`${api_url}auth/register`, "POST", allFields, {});
        console.log(response);
        if (response?.status == 'success') {
            toasted.success(response?.message);
        }
        else {
            toasted.error(response?.message);
        }
    }

    return (
        <>
            <input type="text" value={allFields?.name} onChange={handleChange} className="input-field" />
            <input type="text" value={allFields?.email} onChange={handleChange} />
            <input type="text" value={allFields?.phone} onChange={handleChange} />
            <input type="text" value={allFields?.password} onChange={handleChange} />
            <button onClick={SubmitRegister}>Register</button>
        </>
    )
}
